export default function LostDialog() {

    const { styles } = useStyle();

    const { isOpen, onOpen, onClose } = useDisclosure()

    const { currentModal, api, setCurrentModal, user, setUser } = useApp();

    const initialRef = React.useRef(null)


    useEffect(() => {
        if (currentModal == "loserdialog") {
            onOpen();
        } else {
            onClose();
        }
    }, [currentModal])


    return (
        <>
            <Modal
                initialFocusRef={initialRef}
                isOpen={isOpen}
                onClose={() => {
                    setCurrentModal("");
                }}
                isCentered
            >
                <ModalOverlay />
                <ModalContent
                    backgroundColor={styles.lostDialogBg}
                    border={`2px solid ${styles.losgDialogBorder}`}
                    color={styles.color}
                    maxW='560px'
                    h='260px'
                    overflow='hidden'
                >
                    <Box position='absolute' width='388px' height='370px' left='84px'>
                        <SvgComponent width='100%' height='100%' />
                    </Box>
                    <ModalBody
                        pb={6}
                        display='flex'
                        flexDirection='column'
                        alignItems='center'
                        justifyContent='center'
                        gap='10px'
                    >
                    
                    <Box>
                    <Text width='100%'  color={styles.lostDialogColor} fontSize='42px'>ANOTHER ONE?</Text>
                    </Box>
                    <Box>
                    <Text width='100%' color={styles.lostDialogSubColor} fontSize='16px'>Don&apos;t give up, one more round</Text>

                    </Box>
                        
                      
                    </ModalBody>

                </ModalContent>
            </Modal>
        </>
    )
}